    Immutable. Identifier. 

    <p>

    The <xref href="Glitch9.AIDevKit.Google.GoogleFile" data-throw-if-not-resolved="false"></xref> resource name. The ID (name excluding the "files/" prefix) can contain up to 40 characters 

